import React from "react";
import { useState, useEffect } from "react";

const HeroSection = () => {
    const getPopularMoviestoFeature = () =>{

      const popularMovieEndpoint = `'https://api.themoviedb.org/3/movie/upcoming?language=en-US&page=1?api_key=${process.env.REACT_APP_MOVIE_KEY}`
      const options = {method: 'GET', headers: {accept: 'application/json'}};
      fetch(popularMovieEndpoint, options)
      .then(response => response.json())
      .then(console.log(response.results))
    }
    return (
      <div className="heroSection">
        <section className="light hero">
          <div className="heroInner">
            <span>
              <h1>Title</h1>

            </span>
          </div>
        </section>
      </div>
    );
  };

  export default HeroSection;
